  //     strings: ["Student", "Developer", "Wonderer"],
  //   });
  // }, []);

  const path = "M0,100 Q50,50 100,100 Q150,150 200,100";

  return (
      <Container className="header" sx={{ flexGrow: 6 }}>
        <Grid container >
          <Grid item>
            <Container className="moon">
              <motion.img
                className="moon"
                src={BlueMoon}
                alt="moon"
                animate={{ path: path }}
                transition={{ duration: 20, repeat: Infinity }}
              />
            </Container>
          </Grid>

          <Grid item>
            {/* <Box className="container"> */}
              <Typography variant="h1" className="glowing-text">
                A sense of wonder in a world gone mad
              </Typography>
            {/* </Box> */}
          </Grid>
          <Grid item>
            <Typography variant="h1">
              TUKA A.
            </Typography>
          </Grid>

        </Grid>
      </Container>
  );
}

export default Home;
